import React from "react";
import styled from "styled-components";

const ModalAddTags = ({ content }) => (
  <Container>
    <p>Adicionar tags</p>
  </Container>
);

const Container = styled.section`
  background-color: #fff;
  color: #fff;
  width: 420px;
  height: 450px;
  border-radius: 10px;
  display: flex;
  padding: 20px;
  p {
    font-size: 25px;
    color: #000;
    font-weight: bold;
  }
`;

export default ModalAddTags;
